var IntakeTemperature       = Process_data["Temperatura de entrada"]||0;
var MotorTemperature        = Process_data["Temperatura de motor"]||0;
var DischargeTemperature    = Process_data["Temperatura de descarga"]||0;

var CurrentValue;
if (Selection == "Voltage"){CurrentValue = Voltage.toFixed(2) +" V";}
else if (Selection == "Load") { CurrentValue = Load.toFixed(2) + " A";}
else if (Selection == "BusDC") { CurrentValue = BusDC.toFixed(2) + " V";}
else if (Selection == "THP") { CurrentValue = THP.toFixed(2) + " psi";}
else if (Selection == "THT") { CurrentValue = THT.toFixed(2) + " ºF";}
else if (Selection == "Vibration_Gral") { CurrentValue = Vibration_Gral.toFixed(2) + " G";}
else if (Selection == "LeakageCurrent") { CurrentValue = LeakageCurrent.toFixed(2) + " mA";}
else if (Selection == "IntakePressure") { CurrentValue = IntakePressure.toFixed(2) + " psi";}
else if (Selection == "DischargePressure") { CurrentValue = DischargePressure.toFixed(2) + " psi";}
else if (Selection == "IntakeTemperature") { CurrentValue = IntakeTemperature.toFixed(2) + " ºF";}
else if (Selection == "MotorTemperature") { CurrentValue = MotorTemperature.toFixed(2) + " ºF";}
else if (Selection == "DischargeTemperature") { CurrentValue = DischargeTemperature.toFixed(2) + " ºF";}
else {CurrentValue = "---";}

return [
    { payload: DecPlacces(Voltage,1)},
    { payload: DecPlacces(Load,1)},
    { payload: DecPlacces(BusDC,1)},
    { payload: DecPlacces(THP,2)},
    { payload: DecPlacces(THT,2)},
    { payload: DecPlacces(Vibration_Gral,3)},
    { payload: DecPlacces(LeakageCurrent,3)},
    { payload: DecPlacces(IntakePressure,1)},
    { payload: DecPlacces(DischargePressure,1)},
    { payload: DecPlacces(IntakeTemperature,1)},
    { payload: DecPlacces(MotorTemperature,1)},
    { payload: DecPlacces(DischargeTemperature,1)},
    { payload: CurrentValue}
];

function DecPlacces(value,Places){
    return parseFloat(value.toFixed(Places));
}

var Protections = global.get("Protections",'memoryOnly')||null;
var Keys = Object.keys(Protections);
//
var Disparos=[];
for(var i=0; i<Keys.length; i+=1){
    if(Protections[Keys[i]].HH == true || Protections[Keys[i]].LL == true){
        Disparos.push(true);
    }
    else{
        Disparos.push(false);
    }

}
var array = Object.values(Disparos);
var resp = array.find(element => element == true) || false;
msg.payload = resp;

if(resp){
    global.set("Protections.General",true,'memoryOnly');
    node.status({ fill: "red", shape: "dot", text: "Disparo por protección" });
}
else{
    global.set("Protections.General", false, 'memoryOnly');
    node.status({ fill: "green", shape: "dot", text: "Condición normal" });
}
return msg;

